import React from "react";
import "./Toolbar.css";
import Logo from "../../Logo/Logo";

const Toolbar = () => {
  return (
    <header className="Toolbar">
      <div>MENU</div>
      <Logo />
      <nav>
        <ul>LINKS</ul>
      </nav>
    </header>
  );
};

export default Toolbar;
